histogramDefault_id85(256, :) = sum(histogram_i255k_id85);
histogramDefault_id85(2:255, 256) = (sum(histogram_ij255_id85(:, 2:255))).';

% Set the format to longe to capture the differences in the experimental probabilities
format longe

